import ExpenseItem from "./ExpenseItem";

function ExpensesDisplayer(props) {

    return (
        <div className="expenses">
          <ExpenseItem
            title={props[0]}
            amount={props[0]}
            date={props[0]}
          />
          <ExpenseItem
            title={props[1].title}
            amount={props[1].amount}
            date={props[1].date}
          />
          <ExpenseItem
            title={props[2].title}
            amount={props[2].amount}
            date={props[2].date}
          />
          <ExpenseItem
            title={props[3].title}
            amount={props[3].amount}
            date={props[3].date}
          />
        </div>
      );
}

export default ExpensesDisplayer;
